graphviz:
digraph {
  // Graph attributes
  label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="center"><font point-size="12"><b>Session Management</b></font></td></tr></table>>;
  labelloc="t";
  fontsize=10;
  fontname="Arial";
  compound=true;
  rankdir=TB;
  pad=0.25;
  node [fontname="Arial", fontsize=10];
  edge [fontname="Arial", fontsize=9];

  // Node definitions with nested namespaces
  "CreateSession" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>CreateSession</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Create Session</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "ValidateSession" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>ValidateSession</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Validate Session</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "RefreshSession" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>RefreshSession</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">Refresh Session</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];
  "EndSession" [label=<<table border="0" cellborder="0" cellspacing="0" cellpadding="4"><tr><td align="left"><b>EndSession</b> <i>&lt;state&gt;</i></td></tr><tr><td align="left">End Session</td></tr></table>>, shape=diamond, fillcolor="#F3E5F5", style=filled, color="#7B1FA2"];

  // Edges
  "CreateSession" -> "ValidateSession" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "ValidateSession" -> "RefreshSession" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "RefreshSession" -> "ValidateSession" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
  "ValidateSession" -> "EndSession" [style="dashed", labelOverlay="75%", labelhref="#srcLineTBD"];
}
